import { Icon } from "@iconify/react";
export const Buttons =[{
    btnName : 'Dashboard',
    btnIcon : <Icon icon="humbleicons:dashboard" width="28" rotate={1} hFlip={true} vFlip={true} />
},{
    btnName : 'Courses',
    btnIcon : <Icon icon="healthicons:register-book" width="28"/>,
    second : true
},{
    btnName : 'Stude',
    btnIcon : <Icon icon="healthicons:register-book" width="28"/>,
    second : true
}
]
